import React from 'react';
import { motion } from 'framer-motion';
import { Check, Star, TrendingUp, Zap, ArrowRight } from 'lucide-react';
import { useNavigate } from 'react-router-dom';

const Packages = () => {
  const navigate = useNavigate();

  const packageRoutes = {
    'Map PowerBoost': '/services/map-powerboost',
    'Google Maps iFrame Cloud Stack Boost ðŸš€': '/services/cloud-stack-boost',
    'Local Citations for Local SEO': '/services/local-citations'
  };

  const handleLearnMore = (packageName) => {
    const route = packageRoutes[packageName];
    if (route) {
      navigate(route);
    }
  };

  const packages = [
    {
      name: 'Map PowerBoost',
      price: '$347',
      description: 'One-time Google Maps optimization boost to skyrocket your local rankings',
      features: [
        '300 Local Geotagged Map Points',
        '15-45 mile radius coverage',
        '20 driving direction paths',
        '10 Geotagged images',
        'NAP embedded stacking',
        '99 High DA backlinks',
        '30-Day Drip Feed',
        'Full Indexing Verification'
      ],
      cta: 'Order Now',
      popular: false,
      color: 'from-blue-500 to-blue-600',
      icon: TrendingUp
    },
    {
      name: 'Google Maps iFrame Cloud Stack Boost ðŸš€',
      price: '$347',
      description: 'Boost your Google Business Profile rankings with our powerful cloud stack + map embed strategy. Safe, proven, and effective for local visibility.',
      features: [
        '800x map iFrame embeds',
        'Web 2.0 DA20+ links',
        'YouTube geotagged video embeds',
        '30-day Slow Safe Stacking dripfeed',
        'Full backlink report (Google Sheet)',
        '100% safe â€“ links point to tiered assets, not your main site'
      ],
      cta: 'Order Now',
      popular: true,
      color: 'from-orange-500 to-orange-600',
      icon: Zap
    },
    {
      name: 'Local Citations for Local SEO',
      price: '$347',
      description: 'Supercharge your online presence with 100% manually built, high-DA local citationsâ€”designed to boost your rankings on Google Maps and organic search.',
      features: [
        '150x High DA Local Citations (Premium)',
        'Fresh accounts for each listing',
        '100% NAP consistency (Name, Address, Phone)',
        'Logo included for brand authority',
        'Search engine-friendly placements',
        'Proven ranking improvements',
        'Full report with login access (Google Sheet)'
      ],
      cta: 'Order Now',
      popular: false,
      color: 'from-purple-500 to-purple-600',
      icon: Star
    }
  ];

  return (
    <section id="packages" className="py-20 bg-gray-50">
      <div className="container mx-auto px-4 sm:px-6 lg:px-8">
        {/* Section Header */}
        <motion.div 
          initial={{ opacity: 0, y: 30 }}
          whileInView={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.8 }}
          viewport={{ once: true }}
          className="text-center mb-16"
        >
          <h2 className="text-4xl md:text-5xl font-bold text-primary-900 mb-6">
            Our Local SEO Packages
          </h2>
          <p className="text-xl text-gray-600 max-w-3xl mx-auto">
            Choose the package that fits your needs. All packages include our 30-day results commitment and are designed to dominate Google Maps.
          </p>
        </motion.div>

        {/* Packages Grid */}
        <div className="grid grid-cols-1 lg:grid-cols-3 gap-8 max-w-7xl mx-auto mb-16">
          {packages.map((pkg, index) => (
            <motion.div
              key={pkg.name}
              initial={{ opacity: 0, y: 30 }}
              whileInView={{ opacity: 1, y: 0 }}
              transition={{ duration: 0.6, delay: index * 0.1 }}
              viewport={{ once: true }}
              whileHover={{ y: -8, scale: 1.02 }}
              className={`relative bg-white rounded-2xl p-8 shadow-lg hover:shadow-2xl transition-all duration-300 ${
                pkg.popular ? 'ring-2 ring-orange-500 scale-105' : ''
              }`}
            >
              {/* Popular Badge */}
              {pkg.popular && (
                <div className="absolute -top-4 left-1/2 transform -translate-x-1/2">
                  <div className="bg-gradient-to-r from-orange-500 to-orange-600 text-white px-6 py-2 rounded-full text-sm font-semibold flex items-center gap-2">
                    <Star className="w-4 h-4" />
                    Most Popular
                  </div>
                </div>
              )}

              {/* Package Header */}
              <div className="text-center mb-8">
                <div className="w-16 h-16 bg-gradient-to-r from-primary-500 to-primary-600 rounded-2xl flex items-center justify-center mx-auto mb-4">
                  <pkg.icon className="w-8 h-8 text-white" />
                </div>
                <h3 className="text-2xl font-bold text-primary-900 mb-2">
                  {pkg.name}
                </h3>
                <div className="mb-4">
                  <span className="text-4xl font-bold text-primary-900">{pkg.price}</span>
                  <span className="text-gray-600"> one-time</span>
                </div>
                <p className="text-gray-600 text-sm">{pkg.description}</p>
              </div>

              {/* Features */}
              <ul className="space-y-4 mb-8">
                {pkg.features.map((feature, featureIndex) => (
                  <li key={featureIndex} className="flex items-start gap-3">
                    <Check className="w-5 h-5 text-green-500 mt-0.5 flex-shrink-0" />
                    <span className="text-gray-700 text-sm">{feature}</span>
                  </li>
                ))}
              </ul>

              {/* CTA Buttons */}
              <div className="space-y-3">
                <button className={`w-full py-3 px-6 rounded-xl font-semibold transition-all duration-300 bg-gradient-to-r ${pkg.color} text-white hover:shadow-lg transform hover:scale-105 flex items-center justify-center gap-2`}>
                  {pkg.cta}
                  <ArrowRight className="w-4 h-4" />
                </button>
                {/* Learn More button removed for all packages */}
              </div>
            </motion.div>
          ))}
        </div>

        {/* Package Comparison */}
        <motion.div 
          initial={{ opacity: 0, y: 30 }}
          whileInView={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.8 }}
          viewport={{ once: true }}
          className="max-w-4xl mx-auto mb-16"
        >
          <div className="bg-white rounded-2xl p-8 shadow-lg border border-gray-100">
            <h3 className="text-2xl font-bold text-primary-900 text-center mb-8">
              Which Package is Right for You?
            </h3>
            <div className="grid grid-cols-1 md:grid-cols-3 gap-6">
              <div className="text-center">
                <div className="w-12 h-12 bg-blue-100 rounded-full flex items-center justify-center mx-auto mb-4">
                  <TrendingUp className="w-6 h-6 text-blue-600" />
                </div>
                <h4 className="font-semibold text-blue-900 mb-2">Map PowerBoost</h4>
                <p className="text-gray-600 text-sm">
                  Perfect for quick Google Maps optimization with targeted local strategies
                </p>
              </div>
              <div className="text-center">
